  // File
  //
  /////////////////////////////////////////

  $('.btn-remove-file').on('click', function(e) {
    e.preventDefault();
    var name = $(this).next('input').attr('name');

    $(this).parent().parent().append(
      $('<p />').append($('<input/>').attr('type', 'file').attr('name', name))
    );

    $(this).parent().remove();
  });

